import React from "react";
import "antd/dist/antd.css";
import PropTypes from "prop-types";
const NodeBird = ({ Components }) => {
  <div>공통메뉴</div>;
  return <Components />;
};
NodeBird.propTypes = {
  Components: PropTypes.elementType.isRequired,
};
export default NodeBird;
